var assert = require('assert');
const convert = require('../../src/convert/index.js');
const multipart = require('../../src/convert/multipart.js');

describe('/convert', function () {
  describe('POST', function () {
    it('should convert body to base64 of image', function () {
      let request = {
        httpMethod: "POST",
        headers: {
          "Content-Type": "multipart/form-data; boundary=--------------------------449497451600679615177333"
        },
        body: "",
        lib: {
          multipart: multipart
        }
        
      };
      new convert(request, (status, body, headers) => {
        assert.equal(status, 200, "Status");
        assert.deepEqual(body, {image: {filename: 'ohHayThere.jpg',contentType: 'image/jpeg',base64:""}}, "Body");
      }).invoke();
    });
  });
});